script: |
  super -f text -I q12011.spq | sort > q12011.out

inputs:
  - name: q12011.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 + col2 NOT BETWEEN col0 AND - col1 / col0 + col1 + + col2 * + col0 + col0;
  - name: tab1

outputs:
  - name: q12011.out
    data: |
      85	5	59
